window.bookSummaryJSON = "<p><b>I entered into a bargain—choosing my mate over my freedom.</b></p> <p>But I underestimated the crowned prince who took me. His touch like venom. His vengeance lethal.</p> <p>He craves a power I no longer hold, and he’ll sacrifice every part of me until he gets it.</p> <p>But I don’t belong to him. I belong to his brother. His brother who will come for me, consequences be damned.</p> <p>My fate is entangled between two princes—one who craves my power, the other who covets me—and I have more to lose than I ever imagined.</p> <p>War rages in a game between queens, and I have become their pawn. But I will fight for my life, for my mate, and he will raze kingdoms to get me back.</p>"; 
